pragma solidity >=0.5.12 <0.7.0;

import "./WhiteMange.sol";
import "./SafeMath.sol";

contract OrderDB is WhiteMange {
    struct Order {
        //赠送问题，折扣,批量购买
        uint256    time;       // 时间
        uint256    value;      // 打赏金额
        address    author;   // 顾客
        address    payer;      // 付款方
        bytes16    resId;    // 资源id
    }

    mapping (bytes32 => Order) public store_;


    event LogNewOrder(
        bytes32 orderId,
        bytes16 resourceId,
        address indexed author,
        address indexed payer,
        uint value
    );

    event LogRemoveOrder(bytes32 orderId);

    constructor() public {
       owner = msg.sender;
       admin = msg.sender;
        emit  LogAddress("construcor",admin, owner,msg.sender);
    }

    /**
     * @dev 插入一个新的订单
     * @param _orderId  bytes32 : 订单ID
     * @param _author   address : 顾客
     * @param _resId    bytes16 : 资源id
     * @param _payer    address : 支付地址
     * @param _value     uint256 : 打赏金额
     * @return          bool    : 操作成功返回true
     */
    function insert(bytes32 _orderId, address _author,bytes16 _resId,
                     address _payer,uint256 _value)
        public
        returns(bool)
    {
        if (whitelist_[msg.sender] != true){
            emit LogError(RScorr.Insufficient);
            return false;
        } // Check the caller's whitelist permission.

        if (isExist(_orderId)){
            emit LogError(RScorr.ObjExist);
            return false;
        } // Check if the resource exists.

        store_[_orderId] = Order({
            time : block.timestamp,
            value : _value,
            author : _author,
            payer : _payer,
            resId : _resId
        });

        // store_[_orderId] = Order(now,_price,_cost,_customer,_payer,_claimid);

        emit LogNewOrder(_orderId, _resId, _author, _payer,_value);
        return true;
    }

    /**
     * @dev 删除一个订单
     * @notice 只能由管理员删除
     * @param _orderId bytes32 : 订单ID
     * @return         bool    : 操作成功返回true
     */
    function remove(bytes32 _orderId) public returns(bool) {
        if(msg.sender != owner && msg.sender != admin){
            emit LogError(RScorr.PermissionDenied);
            return false;
        } // 检查管理员权限

        if(store_[_orderId].time == 0){
            emit LogError(RScorr.ObjNotExist);
            return false;
        } // 检查资源是否存在

        delete store_[_orderId];
        emit LogRemoveOrder(_orderId);

        return true;
    }

    // function delete() public returns(bool){}

    // function update() public returns(bool){}

    // function find() public returns(bool){}


    /////////////////////////
    /// View
    /////////////////////////

    /**
     * @dev 判断订单是否存在
     * @param _orderId bytes32 : 订单id
     * @return         bool    : 存在返回true, 不存在返回false
     */
    function isExist(bytes32 _orderId) public view returns(bool){
        if (store_[_orderId].time != 0) {
            return true;
        }
        return false;
    }

    /**
     * @dev 获取订单的详细信息
     * @param _orderId bytes32  : 订单ID
     */
    function getOrderInfoByID(bytes32 _orderId) public view  returns(
        uint256 time,     uint256 value,
        address author, address payer,  bytes16 resId)
    {

        return(
            store_[_orderId].time,
            store_[_orderId].value,
            store_[_orderId].author,
            store_[_orderId].payer,
            store_[_orderId].resId
        );
    }
}

